import React, { useState, useEffect } from "react";
import IndexNavbar from "components/Navbars/IndexNavbar.js";
import Footerr from "components/Footers/Footerr";

function MyTickets() {
  // ... (le reste du composant reste inchangé)

  return (
    <>
      <IndexNavbar />

      <div style={container}>
        <div style={contentWrapper}>
          <div style={headerContainer}>
            <img 
              src="https://img.icons8.com/clouds/300/customer-support.png" 
              alt="Support client" 
              style={headerImage}
            />
            <h1 style={title}>
              Support Client
              <span style={titleUnderline}></span>
            </h1>
          </div>

          <div style={ticketGrid}>
            {/* ... (le reste du JSX) */}
          </div>
        </div>
      </div>

      <Footerr />
    </>
  );
}

// STYLES COMPLETS ET CORRIGÉS
const container = {
  flex: 1,
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  padding: '2rem',
  backgroundColor: '#f1f3f6',
  minWidth: '100vw',
};

const contentWrapper = {
  width: '100%',
  maxWidth: '1200px',
  padding: '20px',
};

const headerContainer = {
  display: 'flex',
  alignItems: 'center',
  gap: '2rem',
  marginBottom: '3rem',
  position: 'relative',
  flexDirection: 'column',
  textAlign: 'center',
};

const headerImage = {
  width: '120px',
  height: '120px',
  filter: 'drop-shadow(0 4px 8px rgba(0,0,0,0.1))',
};

const title = {
  color: '#1a237e',
  fontSize: '2.5rem',
  fontWeight: '600',
  margin: 0,
  textShadow: '2px 2px 4px rgba(0,0,0,0.1)',
  position: 'relative',
};

const titleUnderline = {
  display: 'block',
  width: '60px',
  height: '4px',
  backgroundColor: '#1a237e',
  borderRadius: '2px',
  margin: '0.5rem auto 0',
};

const ticketGrid = {
  display: 'grid',
  gap: '2rem',
  gridTemplateColumns: '1fr',
};

// ... (ajouter le reste des styles de l'original ici)

export default MyTickets;
